MongoDB : Match one object with a new column and get a combined new data<p>I am making an app where I will set number of quiz sets, which will carry number of questions, options and correct answers. </p>

<p>The individual question will appear to user as a form with no answer, and the soon user will select option and submit the form it will go to another data set named "Answers". each answer object will carry the "participated_user_id", "quiz_id", "answers". The answer will carry each "question_id" and "user_answer".</p>

<p>Now I want some query which will club these two data sets and in "quiz" set add "user_answer" after each question.</p>

<h1>QUIZ</h1>

<pre><code>{
_id : 856803,
title : My quiz title,
active : on,
questions : [
  {
    _id : 135224,
    options : [a, b c, d],
    question : here is my question one ?,
    answer : a,
  },
  {
    _id : 135229,
    options : [a, b c, d],
    question : here is my question two ?,
    answer : a,
  }
 ]
}
</code></pre>

<h1>ANSWERS</h1>

<pre><code>{
  _id : 1234,
  quiz_id : 856803,
  answers : [
     {
        _id: 2367,
        question_id : 135224,
        answer : a
     } ,
     {
        _id: 2364,
        question_id : 135229,
        answer : c
     } 
  ]
}
</code></pre>

<h1>I Want</h1>

<pre><code>{
_id : 856803,
title : My quiz title,
active : on,
questions : [
  {
    _id : 135224,
    options : [a, b c, d],
    question : here is my question one ?,
    answer : a,
    user_answer : a
  },
  {
    _id : 135229,
    options : [a, b c, d],
    question : here is my question two ?,
    answer : a,
    user_answer : c
  }
 ]
}
</code></pre>

