MongoDB how to $project (limit fields) from the $lookup remote collection?<p>I want to $lookup for a remote collection like SQL Join but with Mongo. And I don't want all of the keys from the remote document to be pulled to the origin collection - just some specific keys.</p>

<p>This is what I have tried:</p>

<pre><code>[
  {
    $lookup: {
        from: "tables",
        localField: "type",
        foreignField: "_id",
        as: "type"
      }
    },
    {
      $unwind: "$type"
    },
  },
  {
    $project: {
      "type.title": 1
    }
  }
]
</code></pre>

<p>However this prints only "type.title" and ignores all of other keys even from the origin document.</p>

<p>Is there any way to tell MongoDB to pull only specific fields from the remote collection?</p>

