Create a firebase style permission hierarchy in mongoDB<p>New to MongoDB, and working with NodeJS's <a href="https://www.npmjs.com/package/mongodb" rel="nofollow noreferrer">mongodb package</a>, I am trying to retrieve and update items based on a user's permission levels  which are also stored in a collection. </p>

<p>I understand how to fetch all items:</p>

<pre><code> const collection = db.collection('events');
  // Find some documents
  collection.find({}).toArray(function(err, docs) {
    assert.equal(err, null);
    console.log("Found the following records");
    console.log(docs)
    callback(docs);
  });
</code></pre>

<p>But I wonder whether, given the following data structure:</p>

<pre><code>{
    events: {
        1: {
            id: 1,
            name: "first event",
        },
        2: {
            id: 2,
            name: "2nd event",
        },
        3: {
            id: 3,
            name: "3rd event",
        },
    },
    permissions: {
        events: {
            1: {
                user1: "read",
                user2: "write",
            },
            2: {
                user2: "write",
            },
            3: {
                user1: "readwrite",
                user2: "write",
            },
        },
    },
 }
</code></pre>

<p>and given you are logged in as User1, the above fetch code can fetch only the relevant events which user1 has read access to according to the permissions specified?</p>

<p>For CRUDS such as updates, deletes and inserts, I can run a separate query and see whether the user has the needed access. However, get queries are common and IMHO should be straightforward so I wonder how this filtering can be done elegantly?</p>

